Anna Kaziunas France teaches the &quot;how to make (almost) anything&quot; rapid prototyping course in digital fabrication at the Fab Academy at AS220. She is also the Dean of Students for the Global Fab Academy program. She wears many hats and has worked as an information architect, user experience designer, usability specialist, interaction designer, experimental fabricator, artist and teacher. She loves Providence, Rhode Island and is in the process of scanning and printing it.
